import React from "react";
import TodoForm from './TodoForm'
import TodoList from "./TodoList";

const todos = [
    { id: 1, message: 'Be confident' },
    { id: 2, message: 'Shoulders back' },
    { id: 3, message: 'Chin towards God' }
  ]

function Todos() {
    return(
        <div>
            <TodoForm />
            <TodoList />
        </div>
    )
}

export default Todos;
